import React, { useState } from 'react';
import classNames from 'classnames';

const LoginForm = ({ onLogin, onRegister }) => {
  const [active, setActive] = useState('login');
  const [surname, setSurname] = useState('');
  const [firstname, setFirstname] = useState('');
  const [patronymic, setPatronymic] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const onChangeHandler = (event) => {
    const name = event.target.name;
    const value = event.target.value;

    switch (name) {
      case 'surname':
        setSurname(value);
        break;
      case 'firstname':
        setFirstname(value);
        break;
      case 'patronymic':
        setPatronymic(value);
        break;
      case 'email':
        setEmail(value);
        break;
      case 'password':
        setPassword(value);
        break;
      default:
        break;
    }
  };

  const onSubmitLogin = (e) => {
    e.preventDefault();
    onLogin(email, password);
  };

  const onSubmitRegister = (e) => {
    e.preventDefault();
    onRegister(surname, firstname, patronymic, email, password);
  };

  return (
    <div className="flex justify-center">
      <div className="w-1/4">
        <ul className="flex mb-3 justify-center">
          <li>
            <button
              className={classNames(
                'py-2 px-8 text-sm rounded-tl-md rounded-bl-md focus:outline-none',
                active === 'login' ? 'bg-blue-700 text-white' : 'bg-gray-200 text-gray-600'
              )}
              id="tab-login"
              onClick={() => setActive('login')}
            >
              Авторизация
            </button>
          </li>
          <li>
            <button
              className={classNames(
                'py-2 px-8 text-sm rounded-tr-md rounded-br-md focus:outline-none',
                active === 'register' ? 'bg-blue-700 text-white' : 'bg-gray-200 text-gray-600'
              )}
              id="tab-register"
              onClick={() => setActive('register')}
            >
              Регистрация
            </button>
          </li>
        </ul>

        <div className="p-4 bg-white">
          <div
            className={classNames('tab-pane', active === 'login' ? 'block' : 'hidden')}
            id="pills-login"
          >
            <form onSubmit={onSubmitLogin}>
              <div className="mb-4">
                <input
                  type="email"
                  id="email"
                  name="email"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="email">
                  Эл. адрес
                </label>
              </div>

              <div className="mb-4">
                <input
                  type="password"
                  id="password"
                  name="password"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="password">
                  Пароль
                </label>
              </div>

              <button
                type="submit"
                className="w-full py-2 px-4 text-sm text-white bg-blue-700 rounded focus:outline-none"
              >
                Войти
              </button>
            </form>
          </div>

          <div
            className={classNames('tab-pane', active === 'register' ? 'block' : 'hidden')}
            id="pills-register"
          >
            <form onSubmit={onSubmitRegister}>
              <div className="mb-4">
                <input
                  type="text"
                  id="surname"
                  name="surname"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="surname">
                  Фамилия
                </label>
              </div>

              <div className="mb-4">
                <input
                  type="text"
                  id="firstname"
                  name="firstname"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="firstname">
                  Имя
                </label>
              </div>

              <div className="mb-4">
                <input
                  type="text"
                  id="patronymic"
                  name="patronymic"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="patronymic">
                  Отчество
                </label>
              </div>

              <div className="mb-4">
                <input
                  type="email"
                  id="registerEmail"
                  name="email"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="registerEmail">
                  Эл. адрес
                </label>
              </div>

              <div className="mb-4">
                <input
                  type="password"
                  id="registerPassword"
                  name="password"
                  className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none"
                  onChange={onChangeHandler}
                />
                <label className="block mt-1 text-sm text-gray-700" htmlFor="registerPassword">
                  Пароль
                </label>
              </div>

              <button
                type="submit"
                className="w-full py-2 px-4 text-sm text-white bg-blue-700 rounded focus:outline-none"
              >
                Создать аккаунт
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
